module: azure.ai.agentserver.core.models.projects
summary: "Insights from the cluster analysis.\n\n   ivar summary:\n      Summary of\
  \ the insights report. Required.\n\n   vartype summary:\n      ~azure.ai.projects.models.InsightSummary\n\
  \n   ivar clusters:\n      List of clusters identified in the insights. Required.\n\
  \n   vartype clusters:\n      list[~azure.ai.projects.models.InsightCluster]\n\n\
  \   ivar coordinates:\n      Optional mapping of IDs to 2D coordinates used by the\
  \ UX for\n      visualization.\n\nThe map keys are string identifiers (for example,\
  \ a cluster id or a sample id)\nand the values are the coordinates and visual size\
  \ for rendering on a 2D chart.\nThis property is omitted unless the client requests\
  \ coordinates (for example,\nby passing `includeCoordinates=true` as a query parameter).\n\
  Example:\n{\n\n   \"cluster-1\": { \"x\": 12, \"y\": 34, \"size\": 8 },\n   \"sample-123\"\
  : { \"x\": 18, \"y\": 22, \"size\": 4 }\n\n}\nCoordinates are intended only for\
  \ client-side visualization and do not\nmodify the canonical insights results.\n\
  \n   vartype coordinates:\n      dict[str, ~azure.ai.projects.models.ChartCoordinate]"
